import { Container, Nav, Tab, Row, Col } from "react-bootstrap";
import { BlogCard } from "./BlogCard";
import colorSharp2 from "../assets/pics/color-sharp2.png"
import blog1img from "../assets/pics/blog1img.jpg"
import blog2img from "../assets/pics/blog2img.jpg"
import blog3img from "../assets/pics/blog3img.jpg"

export const Blog = ()=> {

    const blog = [
        {
            title: "Blog 1",
            description: "",
            imgUrl: blog1img,
        },
        {
            title: "Blog 2",
            description:"",
            imgUrl: blog2img
        },
        {
            title: "Blog 2",
            description:"",
            imgUrl: blog3img,
        },
    ];

    return (
        <section className="blog" id="blog">
            <Container>
                <Row>
                    <Col>
                        <h2>Blog</h2>
                        <p></p>
                        <Tab.Container></Tab.Container>       
                        <Nav variant="pills" defaultActiveKey="/home">
                        <Nav.Item>
                            <Nav.Link href="first">Tab One</Nav.Link>
                        </Nav.Item>
                        <Nav.Item>
                            <Nav.Link eventKey="second">Tab Two</Nav.Link>
                        </Nav.Item>
                        <Nav.Item>
                            <Nav.Link eventKey="third">
                            Tab Three
                            </Nav.Link>
                        </Nav.Item>
                        </Nav>
                        <Tab.Pane evenKey="first">
                            <Row>
                                {
                                    blog.map((blog, index) => {
                                        return (
                                            <BlogCard key={index} {...blog}/>
                                        )
                                    })
                                }
                            </Row>
                        </Tab.Pane>
                    </Col>
                </Row>
            </Container>
        </section>
    )
}
